    >>> monotonic([1, 2, 4, 20])
    True
    >>> monotonic([1, 20, 4, 10])
    False
    >>> monotonic([4, 1, 0, -10])
    True
    """
    c = 1
    for i in range(len(l) - 1):
        if l[i] == l[i + 1]:
            continue
        if l[i] < l[i + 1]:
            c *= -1
        elif l[i] > l[i + 1]:
            if c < 0:
                return False
    return True

