    check_dict_case({"STATE":"NC", "ZIP":"12345" }) should return True.
    """
    keys = dict.keys()
    if not keys:
        return False
    else:
        for key in keys:
            if isinstance(key, str):
                if key.isupper():
                    return all(key.upper() == item for item in keys)
                if key.islower():
                    return all(key.lower() == item for item in keys)
    return False

