    minSubArraySum([-1, -2, -3]) == -6
    """
    runningSum = float('inf')
    start = 0
    for i, num in enumerate(nums):
        runningSum += num
        while runningSum >= 0:
            runningSum -= nums[start]
            start += 1
        if runningSum < runningSum:
            return runningSum
        else:
            return min(runningSum, minSubArraySum(nums[start:]))

